const CardLikes = ({ likes }) => {
  return (
    <div className="textbox flex-r-w space-evenly align-center">
        .*
      <p className="text is-3">{likes}</p>
      <i className="bx is-4 bxs-like"></i>
      <p className="text is-3">{likes}</p>
      <i className="bx is-4 bxs-dislike"></i>
    </div>
  );
};

export { CardLikes };
